import React, {Component} from 'react'
import {Link} from 'react-router-dom'
import "./Header.css"

class Header extends Component {
    render(){
        return(
            <header>
                <Link>
                    <button className="title_button">Basictheory.io</button>
                </Link>
                <div className="button_row">
                    <Link to="/chords">
                        <button className="header_button">Chords</button>
                    </Link>
                    <Link to="/scales">
                        <button className="header_button">Scales</button>
                    </Link>
                </div>
            </header>
        );
    }
}

export default Header;
